// src/components/GetAllBookings.tsx
import React, { useState, useEffect } from 'react';
import { getAllBookings } from '../api';

const GetAllBookings: React.FC = () => {
  const [bookings, setBookings] = useState<any[]>([]);

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        const response = await getAllBookings();
        setBookings(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchBookings();
  }, []);

  return (
    <div>
      <h2>All Bookings</h2>
      <ul>
        {bookings.map((booking) => (
          <li key={booking.id}>
            Booking ID: {booking.id} - Flight ID: {booking.flightId} - User ID: {booking.userId} - Passenger Name: {booking.passengerName} - Seat Number: {booking.seatNumber}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default GetAllBookings;
